#include <iostream>
#include <string>
#include <vector>
#include <algorithm>

using namespace std;

/* <ul style="text-align: center;"><li style="text-align: center;">Descripton of Coding Problem:</li><li>The while loop represents the game.</li><li>Each iteration represents a turn of the game</li><li>where you are given inputs (the heights of the mountains)</li><li>and where you have to print an output (the index of the mountain to fire on)</li><li>The inputs you are given are automatically updated according to your last actions.</li><li>Resources:</li><li><a href="https://en.cppreference.com/w/cpp/container/vector">Vector</a> ,</li><li><a href="https://en.cppreference.com/w/cpp/algorithm/max_element">max_element</a></li></ul> */

int main(){

    // Image of brainstorming:
    //
    // <img src="data:image/png;base64," width="340" height="272">
    //
    // The folowing solution creates the vector Mount_H that stores the hights
    // of the different mountains.
    //
    // Line 41 gets the highest mountain.
    //
    // Line 44 sets the index of the hightest mountain as the target.
    //
    // Line 51 sets the value of the highest mountain in vector Mount_H to 0.
    //
    // Line 54 prints the value of the target to the console which "fires on the
    // mountain."
    //
    // Vector of Mountain Heights
    vector<int> Mount_H = {0,0,0,0,0,0,0,0} ;
    vector<int>::iterator max_Mount;

    // Target to shoot at, should be the index of target, not height
    int target;
    // Game loop
    while (1) {
        for (int i = 0; i < 8; i++) {
            int mountain_h; // represents the height of one mountain.
            cin >> mountain_h; cin.ignore();
            Mount_H[i] = mountain_h; // Fills a vector of mountain heights
            //cerr << "Debug: " << i <<":" << Mount_H[i]<< endl; // debug message
        }

        // Write an action using cout. DON'T FORGET THE "<< endl"

        // To debug: cerr << "Debug messages..." << endl;
        
        // gets max element
        max_Mount = max_element(Mount_H.begin(),Mount_H.end());

        // gets index of max element for target
        target =  distance(Mount_H.begin(), max_Mount);

        /* ```
               Debug Messages
               // cerr << "Target: " << target << endl; // Debug message
               // cerr << "size: " << Mount_H.size() << endl; // Debug message
           ``` */

        Mount_H[target] = 0;

        // The index of the mountain to fire on
        cout << target << endl; 
    }
}
